import React from 'react';
import LogoImage from '../assets/images/logo.png';

function Logo() {
  return (
    <div className='logo text-center my-5'>
      <img
        src={require("../assets/images/logo.png")}
        alt="Integrity Protection"
        className="img-fluid"
        style={{ maxWidth: '250px' }}
      />
    </div>
  );
}

export default Logo;
